import { useEffect, useState } from "react";
import Link from "next/link";

const NavbarMain = () => {
	const [scroll, setScroll] = useState(0);

	useEffect(() => {
		document.addEventListener("scroll", () => {
			const scrollCheck = window.scrollY < 100;
			if (scrollCheck !== scroll) {
				setScroll(scrollCheck);
			}
		});
	}, [scroll]);

	const navClass = "nav-main sticky-top navbar navbar-expand-lg navbar-light ";

	return (
		<nav
			className={
				scroll
					? `${navClass} transition-ease`
					: `${navClass} nav-main-scroll transition-ease`
			}
		>
			<div
				className={
					scroll
						? "container justify-content-center transition-ease"
						: "container justify-content-end transition-ease"
				}
			>
				<div className='transition-ease'>
					<button
						class='navbar-toggler'
						type='button'
						data-toggle='collapse'
						data-target='#navbarTogglerDemo02'
						aria-controls='navbarTogglerDemo02'
						aria-expanded='false'
						aria-label='Toggle navigation'
					>
						<span class='navbar-toggler-icon'></span>
					</button>
					<div
						class='collapse navbar-collapse transition-ease '
						id='navbarTogglerDemo02'
					>
						<ul class='navbar-nav mr-auto mt-2 mt-lg-0 transition-ease'>
							<li class='nav-item active transition-ease'>
								<a class='nav-link' href='#'>
									Home <span class='sr-only'>(current)</span>
								</a>
							</li>
							<li class='nav-item transition-ease'>
								<a class='nav-link' href='#'>
									Link
								</a>
							</li>
							<li class='nav-item transition-ease'>
								<a class='nav-link disabled' href='#'>
									Disabled
								</a>
							</li>
						</ul>
					</div>
				</div>
			</div>
		</nav>
	);
};

export default NavbarMain;
